INSERT INTO `faqs` (`question`, `answer`) VALUES
('What services do architects provide?', 'Architects see the big picture when it comes to your project. They help you explore what appeals to you aesthetically and what you require functionally. They coordinate teams of design, engineering and construction professionals; they sort through the maze of building codes and zoning requirements; they provide design leadership so that your project is built the way it was intended.'),
('At what point in my project should I involve an architect?', 'As soon as you decide you want to begin planning your project, you should start looking for an architect. Architects provide important pre-design services including site evaluation, and can help you explore options you may not have considered. Involving an architect early in the process can help avoid costly missteps, and increase the likelihood of your satisfaction with the project.'),
('How do I find the right architect for my project?', 'It is critical to find an architect who makes you feel comfortable, and with whom you can have open communication. It\'s also important to find an architect with experience in your project type. The design website Houzz has an architect finder that can serve as an important first step in your search; you should also seek recommendations from those you know who\'ve worked with an architect previously.'),
('Do not architects add substantial cost to a project?', 'While it is true that architects fees are an additional project cost, hiring an architect can actually save you money in many ways. Architects can monitor your budget and negotiate to get the best materials and workmanship at a good price. An architects design can reduce energy and maintenance costs, and provide an efficient layout so that you do not overbuild what you really need. They can turn a difficult lot into a successful building site. And they spend time planning and fully developing your ideas to avoid changes once construction is underway.'),
('How are architects compensated?', 'An architects compensation can be based on time, a stipulated sum, a percentage of the cost of the work, the projects square footage, unit cost (based on number of rooms/apartments, etc.), or royalty in which compensation is a share of the profit derived from the project. Time-based compensation and stipulated sums are most common.');

